import React from 'react';

export default () => (
  <header className="menu">
    <div className="center-content">
      <div className="_logo">
        <a href="/#">
          <img src="assets/images/claro-logo.png" alt="Claro Logo" />
        </a>
      </div>
    </div>
  </header>
);
